.container {
  position: relative;
  background-color: #fff;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.border {
  border-style: solid;
  border-width: 1px;
}
.loading {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(0, 0, 0, 0.3);
  opacity: 0.3;
  filter: alpha(opacity=30);
  cursor: not-allowed;
  background-position: center;
  background-repeat: no-repeat;
  background-image: url("@/assets/icon/loading.gif");
}
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60); 
  cursor: not-allowed;
}
